        static void MovePlayer(Player player,char[,] board)
        {
            ErasePlayer(player);
            if(Keyboard.IsKeyPressed(Key.LeftArrow))
            {
                if (board[player.pY,player.pX+1]==' ' && board[player.pY+1, player.pX+1]==' ' && board[player.pY+2, player.pX-1]==' ')
                {
                    player.pX--;
                }
            }
            if (Keyboard.IsKeyPressed(Key.RightArrow))
            {
                if (board[player.pY, player.pX+3]==' ' && board[player.pY+1, player.pX+3]==' ' && board[player.pY+2, player.pX+3]==' ')
                {
                    player.pX++;
                }
            }
            if (Keyboard.IsKeyPressed(Key.UpArrow))
            {
                if (board[player.pY-1, player.pX]==' ' && board[player.pY-1, player.pX+1]==' ' && board[player.pY-1, player.pX+2]==' ')
                {
                    player.pY--;
                }
            }
            if (Keyboard.IsKeyPressed(Key.DownArrow))
            {
                if (board[player.pY+3, player.pX]==' ' && board[player.pY+3, player.pX+1]==' ' && board[player.pY+3, player.pX+2]==' ')
                {
                    player.pY++;
                }
            }
            PrintPlayer(player);
        }
        static void ErasePlayer(Player player)
        {
            Console.SetCursorPosition(player.pX,player.pY);
            {
                Console.Write("   ");
            }
            Console.SetCursorPosition(player.pX, player.pY+1);
            {
                Console.Write("   ");
            }
            Console.SetCursorPosition(player.pX, player.pY+2);
            {
                Console.Write("   ");
            }
        }
        static void PrintPlayer(Player player)
        {
            for (int i = 0; i < player.player.GetLength(0); i++)
            {
                for (int j = 0; j < player.player.GetLength(1); j++)
                {
                    Console.SetCursorPosition(player.pX+j, player.pY+i);
                    Console.Write(player.player[i, j]);
                }
                Console.WriteLine();
            }
        }
        static void PrintBoard(char[,] board)
        {
            for (int i = 0; i < board.GetLength(0); i++)
            {
                for (int j = 0; j < board.GetLength(1); j++)
                {
                    Console.Write(board[i, j]);
                }
                Console.WriteLine();
            }
        }
